import BreakButtonType from './BreakButton.type';

export const startBreak=({breakName})=>{
    return{
    type:BreakButtonType.START_BREAK,
    breakName:breakName,}
}

export const pauseBreak=({breakName})=>{
    return{
    type:BreakButtonType.PAUSE_BREAK,
    breakName:breakName,}
}
